// Função para encontrar o segundo maior elemento de um vetor
void m_s_maior(int *vet, int tamanho, int *maior_num, int *segundo_maior) {
    if (tamanho < 2) {
        printf("O vetor precisa ter pelo menos dois elementos para encontrar o segundo maior.\n");
        return;
    }

    *maior_num = vet[0];
    *segundo_maior = vet[1];

    for (int i = 1; i < tamanho; i++) {
        if (vet[i] > *maior_num) {
            *segundo_maior = *maior_num;
            *maior_num = vet[i];
        } else if (vet[i] > *segundo_maior && vet[i] != *maior_num) {
            *segundo_maior = vet[i];
        }
    }
}

